const initialData = {
  tasks: {
    "task-1": {
      id: "task-1",
      content: "work out",
    },
    "task-2": {
      id: "task-2",
      content: "code",
    },
    "task-3": {
      id: "task-3",
      content: "eat",
    },
    "task-4": {
      id: "task-4",
      content: "sleep",
    },
  },
  columns: {
    "column-1": {
      id: "column-1",
      title: "To do",
      taskIds: ["task-1", "task-2", "task-3", "task-4"],
    },
  },
  //Facilitate reordering of the colums:
  columnOrder: ["column-1"],
};

export default initialData;
